query:
/*+ NoHashJoin(mi_idx t ci) */ select count(*)
from title AS t
inner join movie_info_idx AS mi_idx
on t.id = mi_idx.movie_id AND t.kind_id < 7 AND t.production_year < 2012 AND mi_idx.info_type_id = 101
inner join cast_info AS ci
on t.id = ci.movie_id AND ci.person_id = 2677429 AND ci.role_id < 3;
